import './Box.css';
import Media from 'react-media';

// Return Box view 
export default function ReturnBox() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = () => (
 <div className='wrp-box-list'>
  <List />
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-box-list-sm'>
  <List />
 </div>
);
export const List = () => (
 <ul>
  <li><span>01</span><span>3 conseils pour faire de votre argent une maison sûre</span></li>
  <li><span>02</span><span>Conseils pour naviguer dans les grands changements de la vie</span></li>
  <li><span>03</span><span>Premier travail</span></li>
  <li><span>04</span><span>vous aide à soutenir votre famille en vous donnant la possibilité d'envoyer</span></li>
 </ul>
);
